neral Election Studies (BGES). Since 1983 it has been directed by Anthony Heath, Roger Jowell and John Curtice and carried out jointly by SCPR and Nuffield College Oxford. The 1992 BES surveys were carried out as part of the activities of the ESRC-funded Joint Unit for the Study of Social Trends (JUSST). The 1997 studies were carried out by its successor, CREST, in collaboration with Pippa Norris of Harvard University, with funding from the ESRC, the Gatsby Charitable Foundation and the Commission for Racial Equality. The 1997 British General Election Study included a greater number of separate but inter-linked studies than ever before.",jLb='The URL ',ZUb='The app may be out of date. Reload this page in your browser.',CPb='The response could not be deserialized',X0b='There is already an active upload, try later.',zPb='This application is out of date, please click the refresh button on your browser.',APb='This application is out of date, please click the refresh button on your browser. ( ',W0b='This file was already uploaded.',_Ub='This is taking too long, try again',rQb="This widget's parent does not implement HasWidgets",u2b='Throwable',H9b='Throwable;',sMb='Thu',lMb='Thursday',nbc='Time',w4b='TimeZone',C0b='Timeout sending the file:\n perhaps your browser does not send files correctly,\n your session has expired,\n or there was a server error.\nPlease try again.',p2b='Timer',U5b='Timer$1',obc='Timestamp',PMb='Too many percent/per mille characters in pattern "',QQb='Top',M3b='TouchCancelEvent',N3b='TouchEndEvent',L3b='TouchEvent',O3b='TouchEvent$TouchSupportDetector',P3b='TouchMoveEvent',A5b='TouchScroller',B5b='TouchScroller$1',C5b='TouchScroller$2',D5b='TouchScroller$3',E5b='TouchScroller$4',F5b='TouchScroller$5',G5b='TouchScroller$6',H5b='TouchScroller$MomentumCommand',I5b='TouchScroller$MomentumCommand$1',J5b='TouchScroller$MomentumTouchRemovalCommand',K5b='TouchScroller$TemporalPoint',Q3b='TouchStartEvent',S8b='Tree',T8b='Tree$ImageAdapter',U8b='TreeItem',V8b
